  true,\n\t\"url\": null,\n\t\"notes\": \"This data set contains payroll and personnel
  data for current and past DOT employees.  This data is produced by the current HR
  and payroll provider (Department of Interior's IBC) with historical data also maintained
  in the dataset produced by DOT's CUPS, CPMIS and IPPS systems.  The data contains
  PII (Employee Name, SSN, Date of Birth, Home Address, Financial information, etc.),
  Civil Rights (Disability, Gender, Race) and other sensitive data (Background Investigations
  and Security Clearance).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
